import { Sidebar, Menu, MenuItem } from 'react-pro-sidebar';
import { Link } from 'react-router-dom';

function SideBar () {
    return (  
        <Sidebar>
        <Menu
            menuItemStyles={{
            button: {
                // the active class will be added automatically by react router
                // so we can use it to style the active menu item
                [`&.active`]: {
                backgroundColor: '#13395e',
                color: '#b6c8d9',
                },
            },
            }}
        >
            <MenuItem component={<Link to="/nhan_vien" />}> Nhân viên</MenuItem>
            <MenuItem component={<Link to="/san_pham" />}> Sản phẩm</MenuItem>
            <MenuItem component={<Link to="/dich_vu" />}> Dịch vụ</MenuItem>
        </Menu>
        </Sidebar>
    );
}

export default SideBar;
